	module.exports = "<h3 id=\"prerequisites-and-installation\">Prerequisites and Installation</h3>\n<p>You&#39;ll need to have <a href=\"http://git-scm.com/\">Git</a> installed on your system.</p>\n<p>Installation steps:</p>\n<ol>\n<li>Install <a href=\"http://git-scm.com/\">Git</a>.</li>\n<li>Clone this repository.</li>\n<li>Optionally run <code>./scripts/install</code> to install <a href=\"https://nodejs.org/en/\">Node</a>) via <a href=\"https://github.com/creationix/nvm\">nvm</a>.</li>\n<li>Run <code>npm install</code></li>\n</ol>\n<h3 id=\"development\">Development</h3>\n<ul>\n<li><code>npm run start:watch</code> runs the dev server to run/develop examples. You can then visit <a href=\"http://localhost:8080\">http://localhost:8080</a> in a browser. When you make changes to the source code in the <code>lib</code> directory you should see the page auto-reload.</li>\n<li><code>npm test</code> will run the tests.</li>\n<li><code>npm run test:watch</code> will run the tests and watch for changes to the source code. Run this if you&#39;d like to debug tests in the browser (Chrome).</li>\n<li><code>npm start</code> will build the production version of the documentation. You can view it at <a href=\"http://localhost:8001\">http://localhost:8001</a>.</li>\n</ul>\n<p>Run <code>npm run</code> to list the available commands.</p>\n<h3 id=\"linting-and-code-formatting\">Linting and Code Formatting</h3>\n<p>Linting is run as part of the build. If you use the Sublime Text editor you can set up the following plugins to catch\nlinting and formatting errors earlier.</p>\n<ol>\n<li>Install the <a href=\"https://github.com/sindresorhus/editorconfig-sublime\">EditorConfig Plugin</a></li>\n<li>Install the <a href=\"http://sublimelinter.readthedocs.org/en/latest/\">SublimeLinter Plugin</a></li>\n<li>Install the <a href=\"https://github.com/roadhump/SublimeLinter-eslint\">SublimeLinter Eslint Plugin</a></li>\n<li>Install the <a href=\"https://github.com/kungfusheep/SublimeLinter-contrib-stylelint\">SublimeLinter stylelint Plugin</a></li>\n<li>Install the dependencies:\n<code>npm install</code></li>\n<li>Restart Sublime Text</li>\n</ol>\n<h3 id=\"documentation\">Documentation</h3>\n<p>Please update the documentation with any changes, the code and docs should\nalways be in sync.</p>\n<h3 id=\"build\">Build</h3>\n<p>Please do not include the output of <code>npm run build</code> in your commits.</p>\n";

