	module.exports = "<p>Follow these steps to add a component to the library:</p>\n<ol>\n<li>Run <code>npm run generate</code> and choose a name for your component (use Pascal case, e.g. &#39;MyComponent&#39;).</li>\n<li>Import/export your component in <code>lib/index.js</code>.</li>\n<li>Kill the server (if you had it running) and run <code>npm start</code> to pick up the new component.</li>\n<li>Visit <a href=\"http://localhost:8080\">http://localhost:8080</a> in a browser. You should see your component listed in the docs.</li>\n<li>Start making changes to your component source and watch them update in the browser automatically.</li>\n</ol>\n";

