	module.exports = "<p>To debug your tests and component code in the browser:</p>\n<ol>\n<li>Run <code>npm run test:watch</code>. This command should automatically open up the Chrome browser.</li>\n<li>In Chrome click the &#39;Debug&#39; button at the top of the page (you may have to scroll up).</li>\n<li>Open the <a href=\"https://developers.google.com/web/tools/chrome-devtools/debug/?hl=en\">Developer tools</a> (<code>Command + Shift + C</code>).</li>\n<li>Now you can add breakpoints in the test code or the component code to debug issues. (<code>Command + P</code> in the &#39;Sources&#39; tab)</li>\n</ol>\n<p>If you&#39;d like to run the tests in a different browser (e.g. Firefox or Safari), you can run\n<code>NODE_ENV=test karma start --browsers=Firefox</code>.</p>\n";

