	module.exports = "<h3 id=\"general-requirements\">General Requirements</h3>\n<ul>\n<li>be high contrast aware (use color variables, meet <a href=\"http://www.w3.org/TR/WCAG20-TECHS/G18.html\">4.5:1</a> and <a href=\"http://www.w3.org/TR/WCAG20-TECHS/G183.html\">3:1</a>).</li>\n<li>be keyboard friendly (proper use of tabIndex, logical tab order, ESC to close modals, etc).</li>\n<li>be screenreader friendly (label all inputs, use native controls, use screenreader-only text).</li>\n<li>have good test coverage.</li>\n</ul>\n<h3 id=\"css-conventions\">CSS Conventions</h3>\n<p>The build system uses the webpack css loader and <a href=\"https://github.com/css-modules/css-modules\">css modules</a> to generate\nSuit/BEM style class names, where the &quot;block&quot; portion includes the component name and a configured prefix, so that\nin the .css source for components we only have to worry about &quot;element&quot; and &quot;modifier&quot; class names (using BEM terminology).</p>\n<h4 id=\"element-class-names\">Element Class Names</h4>\n<p>Element classes should be camel case (e.g. <code>inputLabel</code>).</p>\n<h4 id=\"modifier-class-names\">Modifier Class Names</h4>\n<p>Modifiers should also be camel case, with a couple exceptions:</p>\n<ul>\n<li>If part of the classname is dynamically generated in the JS from a component prop, use a double dash before the generated part of the class name. e.g. <code>positioned--left</code> where &quot;left&quot; is a string value passed as a prop <code>positioned</code>.</li>\n<li>For modifiers generated via a boolean prop, use an <code>is-</code>, <code>has-</code> or <code>with-</code> prefix. e.g. <code>is-open</code>, <code>with-padding</code>\nwith component props <code>isOpen</code> and <code>withPadding</code>.</li>\n</ul>\n<h4 id=\"element-and-wildcard-selectors\">Element and Wildcard Selectors</h4>\n<p>As a general rule, element (e.g. <code>p { ... }</code>) and wildcard (<code>*</code>) selectors should be avoided. Exceptions could be made for\ncomponents that would never render children.</p>\n<h4 id=\"css-variables-and-adding-component-themes\">CSS variables and adding component themes</h4>\n<p>All CSS variables should be defined in a <code>theme.js</code> file in the component directory. The theme is applied to the component via the <code>@themeable</code> decorator, which transforms the JS variables in the <code>theme.js</code> file into CSS custom properties that are automatically scoped and applied to the component.</p>\n<p>JS variables in the <code>theme.js</code> file can be nested, and should generally be named using the name of the component state and/or child element and then the camel-cased css property name.</p>\n<p>For example, to add a variable for the <code>hover</code> state of a <code>Button</code> component the theme.js file would contain the following:</p>\n<pre><code>export default function ({ colors }) {\n  return (\n    background: colors.lightest,\n    color: colors.darkest,\n\n    hover: {\n      color: colors.lightest,\n      background: colors.darkest\n    }\n  )\n}\n</code></pre><p>The <code>@themeable</code> decorator will generate the CSS custom properties <code>--Button-background</code>, <code>--Button-color</code>, <code>--Button-hover-color</code>, <code>--Button-hover-background</code>. Use these generated custom property names in the <code>styles.css</code> file for the <code>Button</code> component.</p>\n";

