	module.exports = "<p>To release a new version of the library, follow these steps:</p>\n<ol>\n<li>Run <code>npm run bump:major</code>, <code>npm run bump:minor</code> or <code>npm run bump:patch</code> to update the package version. If you need to specify a version (e.g. for a beta release) you can run <code>npm run bump</code> and enter a version.</li>\n<li>Update the <a href=\"#release-notes\">release notes</a> (this is a manual step for now). Run <code>git commit --amend</code> to add it to the version bump commit.</li>\n<li>Push up the version bump commit to gerrit for review and testing.</li>\n<li>Once the updated package.json file is merged, run <code>npm run release</code></li>\n<li>Verify that the documentation was updated on gh-pages.</li>\n</ol>\n";

