	module.exports = "<h2 id=\"0-18-0\">0.18.0</h2>\n<h4 id=\"document-theme-variables-for-each-component\">Document theme variables for each component</h4>\n<h4 id=\"fix-select-select-component-disabled-state\">Fix <a href=\"#Select\">Select</a> component disabled state</h4>\n<h4 id=\"fix-button-button-component-circle-variant-in-firefox\">Fix <a href=\"#Button\">Button</a> component &#39;circle&#39; variant in Firefox</h4>\n<h4 id=\"-heading-heading-component-updates\"><a href=\"#Heading\">Heading</a> component updates</h4>\n<h4 id=\"fix-progress-progress-\">Fix <a href=\"#Progress\">Progress</a></h4>\n<h4 id=\"make-codepens-work-for-non-jsx-examples-e-g-modal-modal-\">Make codepens work for non jsx examples (e.g. <a href=\"#Modal\">Modal</a>)</h4>\n<h4 id=\"updates-to-tray-tray-component\">Updates to <a href=\"#Tray\">Tray</a> component</h4>\n<h4 id=\"update-textarea-textarea-and-select-select-focus-styles\">Update <a href=\"#TextArea\">TextArea</a> and <a href=\"#Select\">Select</a> focus styles</h4>\n<h4 id=\"add-a-canvas-theme-canvas-\">Add a <a href=\"#canvas\">Canvas theme</a></h4>\n<h4 id=\"add-an-accessible-theme-a11y-\">Add an <a href=\"#a11y\">accessible theme</a></h4>\n<h4 id=\"add-media-media-component\">Add <a href=\"#Media\">Media</a> component</h4>\n<h2 id=\"0-17-3\">0.17.3</h2>\n<h4 id=\"replace-csstransitiongroup-with-transition-transition-component\">Replace CSSTransitionGroup with <a href=\"#Transition\">Transition</a> component</h4>\n<h4 id=\"fix-radioinput-radioinput-and-checkbox-checkbox-focus-issues-in-safari\">Fix <a href=\"#RadioInput\">RadioInput</a> and <a href=\"#Checkbox\">Checkbox</a> focus issues in Safari</h4>\n<h4 id=\"remove-max-width-prop-from-the-alert-alert-component\">Remove <code>max-width</code> prop from the <a href=\"#Alert\">Alert</a> component</h4>\n<h4 id=\"fix-transition-transition-component-unmountonexit-prop\">Fix <a href=\"#Transition\">Transition</a> component <code>unmountOnExit</code> prop</h4>\n<h4 id=\"add-accessiblecontent-accessiblecontent-and-presentationcontent-presentationcontent-\">Add <a href=\"#AccessibleContent\">AccessibleContent</a> and <a href=\"#PresentationContent\">PresentationContent</a></h4>\n<h4 id=\"upgrade-instructure-icons\">Upgrade instructure-icons</h4>\n<h4 id=\"update-progress-progress-component-styles\">Update <a href=\"#Progress\">Progress</a> component styles</h4>\n<h4 id=\"add-tray-tray-component\">Add <a href=\"#Tray\">Tray</a> component</h4>\n<h4 id=\"update-transition-transition-component-styles\">Update <a href=\"#Transition\">Transition</a> component styles</h4>\n<h4 id=\"prevent-errors-in-the-avatar-avatar-component-when-username-prop-is-not-provided\">Prevent errors in the <a href=\"#Avatar\">Avatar</a> component when <code>userName</code> prop is not provided</h4>\n<h2 id=\"0-17-2\">0.17.2</h2>\n<h4 id=\"add-option-to-rangeinput-rangeinput-to-turn-off-value-display\">Add option to <a href=\"#RangeInput\">RangeInput</a> to turn off value display</h4>\n<h4 id=\"fix-popover-popover-bug-uninitialized-state-when-show-prop-is-set\">Fix <a href=\"#Popover\">Popover</a> bug, uninitialized state when show prop is set</h4>\n<h4 id=\"define-all-variables-in-theme-js-for-each-component\">Define all variables in theme.js for each component</h4>\n<h4 id=\"add-a-dismissable-decorator\">Add a dismissable decorator</h4>\n<h2 id=\"0-17-1\">0.17.1</h2>\n<h4 id=\"added-support-for-linux-in-the-generate-script\">Added support for linux in the generate script</h4>\n<p>See <a href=\"https://github.com/instructure/instructure-ui/commit/a9153714552d1dd0f300421de320264140ac4912\">commit</a> for details.</p>\n<h4 id=\"fix-for-table-table-component-to-prevent-nested-tables-from-inheriting-hover-or-stripe-styling\">Fix for <a href=\"#Table\">Table</a> component to prevent nested tables from inheriting hover or stripe styling</h4>\n<h4 id=\"fix-for-tablist-tablist-component-minimal-simple-variants-so-they-no-longer-break-in-a-flexed-container\">Fix for <a href=\"#TabList\">TabList</a> component <code>minimal</code>, <code>simple</code> variants so they no longer break in a flexed container</h4>\n<h4 id=\"fix-modal-modal-component-footer-behavior-when-there-is-minimal-body-content\">Fix <a href=\"#Modal\">Modal</a> component footer behavior when there is minimal body content</h4>\n<h4 id=\"add-zindex-prop-to-the-overlay-overlay-and-popover-popover-components\">Add <code>zIndex</code> prop to the <a href=\"#Overlay\">Overlay</a> and <a href=\"#Popover\">Popover</a> components</h4>\n<h4 id=\"add-custom-chai-assertion-to-verify-that-a-dom-element-exists-for-testing\">Add custom chai assertion to verify that a dom element exists for testing</h4>\n<p>See <a href=\"https://github.com/instructure/instructure-ui/commit/fcea0dd9ee67d172a5eb04e348fb5caf0b93472d\">commit</a> for details.</p>\n<h2 id=\"0-17-0\">0.17.0</h2>\n<h4 id=\"add-a-breadcrumb-breadcrumb-component\">Add a <a href=\"#Breadcrumb\">Breadcrumb</a> component</h4>\n<h4 id=\"prevent-bootstrap-or-other-css-from-interfering-with-component-styles\">Prevent Bootstrap or other CSS from interfering with component styles</h4>\n<h2 id=\"0-16-0\">0.16.0</h2>\n<h4 id=\"add-a-modal-modal-component\">Add a <a href=\"#Modal\">Modal</a> component</h4>\n<h4 id=\"add-a-overlay-overlay-component\">Add a <a href=\"#Overlay\">Overlay</a> component</h4>\n<h4 id=\"add-a-portal-portal-component\">Add a <a href=\"#Portal\">Portal</a> component</h4>\n<h4 id=\"add-focused-getter-to-the-button-button-component\">Add focused getter to the <a href=\"#Button\">Button</a> component</h4>\n<h4 id=\"fix-focus-state-for-checkbox-checkbox-toggle-variant\">Fix focus state for <a href=\"#Checkbox\">Checkbox</a> <code>toggle</code> variant</h4>\n<h4 id=\"fix-rangeinput-rangeinput-passing-props-to-it-s-input\">Fix <a href=\"#RangeInput\">RangeInput</a> passing <code>props</code> to it&#39;s input</h4>\n<h4 id=\"update-to-button-button-design\">Update to <a href=\"#Button\">Button</a> design</h4>\n<h4 id=\"update-to-select-select-don-t-set-disabled-attribute\">Update to <a href=\"#Select\">Select</a> don&#39;t set disabled attribute</h4>\n<h4 id=\"update-transition-transition-component\">Update <a href=\"#Transition\">Transition</a> component</h4>\n<h2 id=\"0-15-0\">0.15.0</h2>\n<h4 id=\"add-a-toggledetails-toggledetails-component\">Add a <a href=\"#ToggleDetails\">ToggleDetails</a> component</h4>\n<h4 id=\"add-a-table-table-component\">Add a <a href=\"#Table\">Table</a> component</h4>\n<h4 id=\"don-t-trigger-popovermenu-popovermenu-on-focus-by-default\">Don&#39;t trigger <a href=\"#PopoverMenu\">PopoverMenu</a> on focus by default</h4>\n<h4 id=\"move-checkbox-checkbox-label-to-the-right-of-the-toggle\">Move <a href=\"#Checkbox\">Checkbox</a> label to the right of the toggle</h4>\n<h4 id=\"add-a-textarea-textarea-component\">Add a <a href=\"#TextArea\">TextArea</a> component</h4>\n<h4 id=\"updates-to-font-sizes-see-typography-typography-component-\">Updates to font sizes (see <a href=\"#Typography\">Typography</a> component)</h4>\n<h2 id=\"0-14-4\">0.14.4</h2>\n<h4 id=\"add-getdisplayname-util-and-use-it-to-determine-component-type\">Add getDisplayName util and use it to determine component type</h4>\n<h2 id=\"0-14-3\">0.14.3</h2>\n<h4 id=\"remove-umd-named-define-from-webpack-config\">Remove umd named define from webpack config</h4>\n<h2 id=\"0-14-2\">0.14.2</h2>\n<h4 id=\"add-missing-type-attribute-on-button-elements-rendered-by-the-button-component\">Add missing type attribute on button elements rendered by the Button component</h4>\n<h2 id=\"0-14-1\">0.14.1</h2>\n<h4 id=\"don-t-bundle-babel-polyfill-with-the-library\">Don&#39;t bundle babel-polyfill with the library</h4>\n<p>This prevents the &quot;only one instance of babel-polyfill is allowed&quot; errors.</p>\n<h2 id=\"0-14-0\">0.14.0</h2>\n<h3 id=\"breaking-changes-code-changes-required-to-upgrade-\">Breaking changes (code changes required to upgrade)</h3>\n<h4 id=\"inject-component-css-into-the-document\">Inject Component CSS into the document</h4>\n<p>Components will now inject the required CSS into the document when they are mounted, so importing the CSS dependencies is no longer required. The usage documentation for each component has been updated to reflect this change.</p>\n<h4 id=\"added-babel-polyfill-as-a-peer-dependency\">Added babel-polyfill as a peer dependency</h4>\n<p>The components now require babel-polyfill.</p>\n<h4 id=\"updates-to-form-input-components\">Updates to form input components</h4>\n<p>All of the form input components now consistently handle focus and validation messages. As a result the <code>errors</code> prop is now the <code>messages</code> prop for all form inputs.</p>\n<h3 id=\"new-components-and-bug-fixes\">New components and bug fixes</h3>\n<h4 id=\"add-progress-component\">Add Progress component</h4>\n<p>See <a href=\"#Progress\">documentation and examples</a> for details.</p>\n<h4 id=\"fix-spinner-component-animation-in-firefox\">Fix Spinner component animation in Firefox</h4>\n<p>See <a href=\"https://github.com/instructure/instructure-ui/commit/f7a0fec6bb95b1baa42e83593a01b50bdab77438\">commit</a> for details.</p>\n<h4 id=\"remove-references-to-the-dom-at-require-time\">Remove references to the DOM at require time</h4>\n<p>This should allow for running tests using instructure-ui components without a browser.</p>\n<h4 id=\"updates-to-colors-and-typography\">Updates to colors and typography</h4>\n<p>The global colors have been updated and the required font family is now Lato. A <a href=\"#Typography\">Typography</a> component has been added.</p>\n<h4 id=\"fix-imports-of-instructure-icons-components\">Fix imports of instructure-icons components</h4>\n<p>Icons are now imported individually to reduce the overall library bundle size.</p>\n<h4 id=\"prevent-react-warnings-by-removing-invalid-props-passed-down-to-children\">Prevent React warnings by removing invalid props passed down to children</h4>\n<h4 id=\"add-levels-to-heading-component\">Add levels to Heading component</h4>\n<p>The <a href=\"#Heading\">Heading</a> component now supports levels 1-5 (and a reset) and also supports overriding the root\nelement.</p>\n";

